import React, { useState } from 'react';

function Experience({ experience, onAdd, onUpdate, onDelete }) {
  const [isAdding, setIsAdding] = useState(false);
  const [editingId, setEditingId] = useState(null);
  const [formData, setFormData] = useState({
    company: '',
    position: '',
    startDate: '',
    endDate: '',
    description: ''
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    if (editingId) {
      onUpdate(editingId, formData);
      setEditingId(null);
    } else {
      onAdd(formData);
    }
    setFormData({
      company: '',
      position: '',
      startDate: '',
      endDate: '',
      description: ''
    });
    setIsAdding(false);
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleEdit = (exp) => {
    setFormData(exp);
    setEditingId(exp.id);
    setIsAdding(true);
  };

  const handleCancel = () => {
    setFormData({
      company: '',
      position: '',
      startDate: '',
      endDate: '',
      description: ''
    });
    setIsAdding(false);
    setEditingId(null);
  };

  const handleDelete = (id) => {
    if (window.confirm('คุณต้องการลบประสบการณ์การทำงานนี้หรือไม่?')) {
      onDelete(id);
    }
  };

  return (
    <div className="section">
      <h2 className="section-title">ประสบการณ์การทำงาน</h2>
      
      {experience.map(exp => (
        <div key={exp.id} className="info-item">
          <h3>{exp.position}</h3>
          <p><strong>บริษัท:</strong> {exp.company}</p>
          <p className="date">
            {exp.startDate} - {exp.endDate}
          </p>
          <p>{exp.description}</p>
          
          <div className="edit-buttons">
            <button className="btn" onClick={() => handleEdit(exp)}>
              แก้ไข
            </button>
            <button className="btn btn-danger" onClick={() => handleDelete(exp.id)}>
              ลบ
            </button>
          </div>
        </div>
      ))}
      
      {isAdding && (
        <div className="edit-mode">
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label>ชื่อบริษัท:</label>
              <input
                type="text"
                name="company"
                value={formData.company}
                onChange={handleChange}
                required
              />
            </div>
            
            <div className="form-group">
              <label>ตำแหน่งงาน:</label>
              <input
                type="text"
                name="position"
                value={formData.position}
                onChange={handleChange}
                required
              />
            </div>
            
            <div className="form-group">
              <label>วันที่เริ่มงาน:</label>
              <input
                type="month"
                name="startDate"
                value={formData.startDate}
                onChange={handleChange}
                required
              />
            </div>
            
            <div className="form-group">
              <label>วันที่สิ้นสุดงาน:</label>
              <input
                type="month"
                name="endDate"
                value={formData.endDate}
                onChange={handleChange}
                required
              />
            </div>
            
            <div className="form-group">
              <label>รายละเอียดงาน:</label>
              <textarea
                name="description"
                value={formData.description}
                onChange={handleChange}
                required
              />
            </div>
            
            <div className="edit-buttons">
              <button type="submit" className="btn">
                {editingId ? 'อัปเดต' : 'เพิ่ม'}
              </button>
              <button type="button" className="btn btn-secondary" onClick={handleCancel}>
                ยกเลิก
              </button>
            </div>
          </form>
        </div>
      )}
      
      {!isAdding && (
        <div className="edit-buttons">
          <button className="btn" onClick={() => setIsAdding(true)}>
            เพิ่มประสบการณ์การทำงาน
          </button>
        </div>
      )}
    </div>
  );
}

export default Experience;
